ホイールナットをお手軽にドレスアップ！<br>
ホイールナットのサビやホイールの盗難防止対策にも！
<br> <br>ホイールを固定するためのホイールナットに対して、簡単に装着することができるシリコンラバー製のカバーがこちらです。<br>
ラインアップは、ボディ色やホイール色などに合わせられるよう、全10色をご用意しています。<br><br>

さらに、ホイールナットのサイズ別に、17mmサイズの17HEXと、19mm&21mmサイズ共用の19・21HEXの2サイズがありますので、合計で20種類の中からお選び頂けます。<br><br>
ホイールナット部に差し色を入れるようなコーディネート的な使い方はもちろん、ホイールナットの錆予防や錆隠しなどにも有効です。<br><br>
さらには、ホイールナットを隠すことにより、イタズラや盗難予防などにも効果を発揮します。<br><br>
